    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True
    if not is_prime(a) and (not is_prime(b)):
        return -1
    MOD = 10 ** 9 + 7
    lcm = a * b // math.gcd(a, b)
    (left, right) = (2, min(a, b) * n)
    while left < right:
        mid = (left + right) // 2
        if mid // a + mid // b - mid // lcm < n:
            left = mid + 1
        else:
            right = mid
    return right % MOD

